import { useState } from 'react';
import '../style/Boardcreate.css';

const Boardcreate = () => {

    const [inputtitle, setInputtitle] = useState('')
    const [inputtext, setInputtext] = useState('')

    const checkInputtitle = (e) => {
        setInputtitle(e.target.value)
    }

    const checkInputtext = (e) => {
        setInputtext(e.target.value)
    }

    return (
        <div className='board-contents-board'>
            <div className='board-contents-boardcreatetitle'>
                <label htmlFor='inputtitle'>ID : </label>
                <input type='text' name='inputtitle' value={inputtitle} onChange={checkInputtitle}/>
            </div>

            <div className='board-contents-boardcreatetext'>
                <label htmlFor='inputtext'>ID : </label>
                <input type='text' name='inputtext' value={inputtext} onChange={checkInputtext}/>
            </div>
        </div>
    )
}

export default Boardcreate;
